, ayy\r\nIn the rain\r\nlet it drip and drop down nonstop\r\nBaby, let me soak and scrub, wash you off in the rain\r\ndrip and drop down nonstop\r\nBaby, let me soak and scrub, wash you off in the rain (what else can I do?)\r\ndrip and drop down nonstop\r\n(No umbrella to hide)\r\nSoak and scrub, wash you off (still I\'m standing here right now)\r\nCan\'t you see? I\'m outside I\'m outside I\'m outside\r\nIn the rain, in the rain, ayy\r\nIn the rain');
