(5, , 'WOKE UP', 'XG', 'Yeah, I\'ve been here waitin\' lookin\' at \'em, tryna catch up, take it how you wanna take it\r\nLeft the place in panic, left to take another planet, left to make another statement\r\nXG, baby, say the names right, spell it out so you can learn it\r\nYou can smell the tires when they turnin\', you can smell the fire when it\'s burnin\'\r\nYou can tell we all made it work for us, made it, but we had to work for it\r\nWork, work, work, so perfect, that it hurt, don\'t it? Surf on \'em\r\nRight away, ride the wave, ride away \'cause we had the right of way\r\nBye-bye-bye, flyin\' past then we fly away into outer-space\r\nDrop top in a coupe outside when I hop up outta this plane\r\nLook at my fit right now when I just walked outta my bed\r\nFix my hair, fix my make-up on the way\r\nBound to the next stop, bound for the great, make \'em bow down to the X, uh\r\nA little more than ordinary honorary, underestimated, leavin\' all you broke\r\nI\'m the judge and jury, I don\'t wanna hear it, I\'m the one they fearin\', keep it on the low\r\nThis is automated, I\'m the motivator, told my haters, \"Yo, more the merrier\"\r\nY\'all my entertainment fascinated, I\'m just laughin\' \'cause it\'s so hilarious\r\nLittle girl with a big mouth, uh, small group with a big house, yeah\r\nBig watch on the wrist now, uh, I just thought of that flow now, just now\r\nPut a little more down for the buss down, went on tour on a bus and tore the bus down\r\nEverythin\' custom now, fans rushin\' out, security had to push me out\r\n48 laws of power, little girl with a big motor on a kid though, mhm\r\nWatch me rip though, watch me snap like Motorola flip phone, mhm\r\nI don\'t wanna hit you this hard on an intro, bring that bounce like 6-4\r\nFind me in Tokyo, rappin\' in a skirt, are you catchin\' my drift, though?\r\nWoke up lookin\' like this, so don\'t get under my skin\r\nWoke up lookin\' like this\r\nWoke up lookin\' like this, so don\'t get under my skin\r\nWoke up lookin\' like this\r\nYeah, light flex go easy (wow), tag it up, graffiti\r\nDrop a pin or addy, that\'s where I\'ll go (go), rip the show and that\'s all I know\r\nI\'m super visioned, y\'all just built on superstitions\r\nWatch me do everythin\', everywhere, all at once, all the time, all around the world\r\nWoke up lookin\' like this (wow), so don\'t get under my skin (don\'t)\r\nX-G-A-L-X, and that\'s the name of this ship (and that\'s it)\r\nDen mother, mother wolf, so don\'t make fun of my kids\r\nWe all fam\' and stand tall now, so don\'t talk down on my kin, hey\r\nWelcome to the party, floatin\' like it\'s Mardi Gras, yeah\r\nYou can call me HARVEY, but I\'m not your barbie doll, yeah\r\nHardy-hardy, huh, laughin\' at \'em while we blast away\r\nBlack on, black on, black, outfits all packed away (packed away)\r\nC to the O-C-O, that\'s me, Lord, have mercy\r\nYoung Queen, but I act like an unnie, young blood, but I\'m built like an OG (yeah)\r\nGotta lift weight for the bags (bags), lookin\' real fit for the mags (mess)\r\nAnd I\'m a wolf in a pack (pack), so I just woof and attack (uh-huh)\r\nWoke up lookin\' like this, so don\'t get under my skin\r\nWoke up lookin\' like this\r\nWoke up lookin\' like this, so don\'t get under my skin\r\nWoke up lookin\' like this');
INSERT INTO `songs` (`id`, `img`, `title`, `artist`, `lyrics`) VALUES
(6, , 'WINTER WITHOUT YOU', 'XG', 'Every year right around this time\r\nPeople putting up trees and lights\r\nAnd I\'ve been thinking that this don\'t feel right\r\n\'Cause I\'m without ya\r\nIf I could make a list, you\'d be the first in it\r\nIf I could make a wish, you\'d show in a minute\r\nOnly if it was that way\r\nBut there\'s some things that I can\'t change\r\nSo now\r\nThis ain\'t winter without ya\r\nNo more joy, no laughter\r\nWish that I could turn it back around\r\nWhen I\'m falling down\r\nSo how\r\nHow am I supposed to go without you?\r\nDays gone cold, so won\'t ya\r\nSay that you\'ll be home for Christmas?\r\nI don\'t care about no mistletoe (mistletoe)\r\nOn the DL, I still miss you though (whoa)\r\nLooking cute at every Christmas party\r\nPosting on my story, still a little snowy, yeah\r\nJoyful, joyful, joyful, raise your voice\r\nEverybody come and raise your voice\r\nSo now, hey\r\nLet me tell the truth\r\nIf I remember, we would sit by the fire holding hands\r\nSweet smell of sugar and spice was heaven-scent\r\nBut like the season, you was gone with the wind\r\nFall winter spring, back around with my December blues\r\nI\'ve been feeling again\r\nSo listen\r\nI really wanna know where we went wrong\r\nI wanna know if you would hear this song\r\nAnd if I could turn back the time\r\nYou\'d be in my arms again\r\nBut there\'s some things that I can\'t change\r\nSo now\r\nThis ain\'t winter without ya\r\nNo more joy, no laughter\r\nWish that I could turn it back around\r\nWhen I\'m falling down\r\nSo how\r\nHow am I supposed to go without ya?\r\nDays gone cold, so won\'t ya\r\nSay that you\'ll be home for Christmas?\r\nHeavy snow pouring out my window (window)\r\nI pray to stars and the angels (oh)\r\nNo, no more lonely nights, no way to hide\r\nWhy I need you for sure\r\nSo I keep wishing and hoping\r\nYou\'d walk through the door (walk through the door)\r\nHold me \'cause I know\r\nWe\'ll fight through the cold (fight through the storm)\r\nAs long as I am with my baby\r\nPlease hurry up, hurry up\r\nI\'ll be stayin\' up all night\r\nNo matter what I unwrap in the morning (ooh-ooh)\r\nI won\'t be the same, I\'d playback every moment (every moment)\r\nThere\'s nobody else to run to, believin\' it like it\'s true\r\nThat you would come to rescue, I merry miss you\r\nNow tell me how\r\nHow am I supposed to go without ya?\r\nDays gone cold, so won\'t ya\r\nSay that you\'ll be home for Christmas?\r\nSo now (ooh, baby, talk to me now)\r\nThis ain\'t winter without ya (this is where I\'m going down)\r\nNo more joy, no laughter (no need to worry about)\r\nWish that I could turn it back around (let me turn it back around)\r\nWhen I\'m falling down\r\nSo how (when it\'s all falling down)\r\nHow am I supposed to go without ya? (Just tell me how)\r\nDays gone cold, so won\'t ya (so, baby, won\'t ya?)\r\nSay that you\'ll be home for Christmas?\r\nOoh, baby, talk to me now\r\nThis is where I\'m going down\r\nNo need to worry about\r\nLet me turn it around\r\nWhen it\'s all falling down\r\nJust tell me how\r\nSo, baby, won\'t ya?');

